import React from 'react'

const Insert = () => {
  const [person, setPerson]= useState({
    id:5,
    name:'무기명',
    address:'서울 금천구 가산동'
  })
  const onInsert=(e)=>{
      e.preventDefault();
  }
  return (
    <div>
        <h1>주소 등록</h1>
        <form onSubmit={onInsert}>
            <input placeholder='이름' value={person.name}/>
            <hr/>
            <input placeholder='주소' value={person.address}/>
            <hr/>
            <button>등록</button>
            <button type='reset'>취소</button>
        </form>
    </div>
  )
}

export default Insert;
